import React, { useEffect, useState } from 'react'

export const Cities = (props) => {

    const [dynamiccity,setDynamicCity]=useState()
    const samecity = (e)=>{
        e.preventDefault();
        setDynamicCity(props.city);
        props.setCity(props.city);
    }

    return (
       <>
         <h3>{dynamiccity}</h3>

        <ul className="city-drop-link-group">
            <li>
            <a href="" onClick={samecity}>{props.city}</a>
            </li>
            </ul>
       </>
    )
}
